import VueRouter from 'vue-router'

import wbAnalyze from '../pages/wbAnalyze';
import home from '../pages/home';
import login from '../pages/login';
import blog_detail from '../pages/blog_detail';
import person_list from '../pages/person_list';
import all_view from '../pages/all_view';
import hot from '../pages/hot';
import WXAnalyze from '../pages/WXAnalyze';
import RmAnalyze from '../pages/RmAnalyze';
import TBAnalyze from '../pages/TBAnalyze';
import tb_detail from '../pages/tb_detail';

export default new VueRouter({
    routes: [{
            path: "/",
            component: home,
            meta: {
                title: "舆情系统"
            }
        },
        {
            path: "/home",
            component: home,
            meta: {
                title: "舆情系统"
            }
        },
        {
            path: "/all_view",
            name: 'all_view',
            component: all_view,
            meta: {
                title: "总览"
            }
        },
        
        {
            path: "/hot",
            component: hot,
            meta: {
                title: "热点事件"
            }
        },
        {
            path: "/wb",
            component: wbAnalyze,
            meta: {
                title: "微博舆情分析"
            }
        },
        {
            path: "/wx",
            name: 'wx',
            component: WXAnalyze,
            meta: {
                title: "微信舆情分析"
            }
        },
        {
            path: "/rm",
            name: 'rm',
            component: RmAnalyze,
            meta: {
                title: "人民网舆情分析"
            }
        },
        {
            path: "/tb",
            name: 'tb',
            component: TBAnalyze,
            meta: {
                title: "贴吧舆情分析"
            }
        },
        {
            path: "/login",
            name: 'login',
            component: login,
            meta: {
                title: "登录注册"
            }
        },
        {
            path: "/blog_detail",
            component: blog_detail,
            meta: {
                title: "博文详情"
            }
        },
        {
            path: "/tb_detail",
            component: tb_detail,
            meta: {
                title: "贴吧详情"
            }
        },
        {
            path: "/person_list",
            component: person_list,
            meta: {
                title: "用户列表"
            }
        }
        
    ],
    mode: "history"
})
